import Head from "next/head";

export default function Home() {
  return (
    <div className="container">
      <Head>
        <title>Naveen DA Portfolio</title>
        <link rel="icon" href="/favicon.ico" />
        <link
          rel="stylesheet"
          href="https://stackpath.bootstrapcdn.com/font-awesome/4.7.0/css/font-awesome.min.css"
        />
        <link
          href="https://fonts.googleapis.com/css2?family=Engagement&family=Lato:wght@300&display=swap"
          rel="stylesheet"
        />
      </Head>
      <header>
        <div className="logo">Naveen DA</div>
        <ul className="links">
          <li>
            <a href="/">Portfolio</a>
          </li>
          <li>
            <a href="/">Contact Me</a>
          </li>
        </ul>
      </header>

      <main>
        <div className="row">
          <div className="col">
            <h1>Hi,</h1>
            <h1>I'm Naveen DA</h1>
            <p>
              I develop an application with high concern about design and UX,
              sometimes I do an over-engineering process for doing a simple job
            </p>
            <p className="icons">
              <a href="https://stackoverflow.com/users/6335029/naveenda">
                <i class="fa fa-stack-overflow" aria-hidden="true"></i>
              </a>
              <a href="https://github.com/NaveenDA">
                <i class="fa fa-github" aria-hidden="true"></i>
              </a>
              <a href="https://twitter.com/NaveenDA_">
                <i class="fa fa-twitter" aria-hidden="true"></i>
              </a>
              <a href="https://dribbble.com/naveenda">
                <i class="fa fa-dribbble" aria-hidden="true"></i>
              </a>
              <a href="http://medium.com/@NaveenDA">
                <i class="fa fa-medium" aria-hidden="true"></i>
              </a>
              <a href="https://www.linkedin.com/in/naveenda/">
                <i class="fa fa-linkedin-square" aria-hidden="true"></i>
              </a>
            </p>
          </div>
          <div className="col"></div>
        </div>
      </main>

      <style jsx>{`
        header {
          height: 45px;
          line-height:45px;
          display:flex;
        }
        header .logo {
          flex:0 100px;
          font-family: "Engagement", cursive;
          padding-left:45px;
        }
        header .links{
          flex:0 calc(100vw - 100px);
          padding-left:45px;

        }
        header .links ul{
          list-style-type: none;
          background: red;
          display: block;
          height: 45px;
          margin-top: 0;
        }
        header .links li{
          display:inline;
          padding-left:12px;
        }
        header .links li a{
          font-size:12px;
          color:#333;
          text-decoration:none !important;
        }
      `}</style>

      <style jsx global>{`
        html,
        body {
          padding: 0;
          margin: 0;
          font-family: "Lato", sans-serif;
          background: #f6f6f6;
        }

        * {
          box-sizing: border-box;
          padding:0;
          margin:0;
        }
      `}</style>
    </div>
  );
}
